import React from "react";
import classnames from "classnames";

import {
  Col,
  Container,
  Nav,
  NavItem,
  NavLink,
  Row,
  TabContent,
  TabPane
} from "reactstrap";

import {DatePicker,Divider,Form,Input,Item,Badge,Button,Icon,Radio,Slider,Select} from 'antd'

import { Home, Settings, MessageSquare,Users,GitMerge } from "react-feather";

const {TextArea} = Input
const { Option } = Select;
const { MonthPicker, RangePicker, WeekPicker } = DatePicker;
class PopoverNode extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      activeTab: "1"
    };
  }

  toggle(tab) {
    if (this.state.activeTab !== tab) {
      this.setState({
        activeTab: tab
      });
    }
  }

  render() {
    const { name, className } = this.props;

    return (
      <div className={"tab " + className}>
        <Nav tabs>
          <NavItem>
            <NavLink
              className={classnames({ active: this.state.activeTab === "1" })}
              onClick={() => {
                this.toggle("1");
              }}
            >
              <Home />
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              className={classnames({ active: this.state.activeTab === "2" })}
              onClick={() => {
                this.toggle("2");
              }}
            >
              <Settings />
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              className={classnames({ active: this.state.activeTab === "3" })}
              onClick={() => {
                this.toggle("3");
              }}
            >
              <Users />
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              className={classnames({ active: this.state.activeTab === "4" })}
              onClick={() => {
                this.toggle("3");
              }}
            >
              <GitMerge/>
            </NavLink>
          </NavItem>
        </Nav>
        <TabContent activeTab={this.state.activeTab}>
          <TabPane tabId="1">
          <Form>
            <Form.Item>
              <Input
                name='task_title'
                value={this.props.task_details.task_title}
                onChange={this.props.newtaskChange(this.props.task_details.task_title)}
                placeholder="Task Title"
              />
            </Form.Item>
            <Form.Item>
            <TextArea

            name='task_desc'
            value={this.props.task_details.task_desc}
            onChange={this.props.newtaskChange(this.props.task_details.task_desc)}
            placeholder="Task Description"
            autoSize={{ minRows: 2, maxRows: 6 }}
          />
  <Divider dashed />
            </Form.Item>
            <Row>
              <Col md="6">
              <Form.Item label="Priority">
              <Select size='default' defaultValue="High"  style={{ width: 200 }}>
                <Option key='1'>Low</Option>
                <Option key='1'>Medium</Option>
                <Option key='1'>High</Option>
              </Select>

              </Form.Item>
              </Col>
              <Col md="6">
              <Form.Item label="Status">
              <Select size='default' defaultValue="Started"  style={{ width: 200 }}>
                <Option key='1'>Active</Option>
                <Option key='2'>Pending</Option>
                <Option key='3'>Done</Option>
              </Select>

            </Form.Item>
              </Col>
            </Row>
            <Form.Item label="Start and End">
              <RangePicker onChange='' />
            </Form.Item>
            </Form>
          </TabPane>
          <TabPane tabId="2">

          </TabPane>
          <TabPane tabId="3">

          </TabPane>
        </TabContent>
      </div>
    );
  }
}

export default PopoverNode
